// src/components/AboutPage/TeamSection.js
import React from 'react';
import 'TeamSection.css';

function TeamSection() {
  return (
    <section className="team-section">
      <h2>Meet the Team</h2>
      <div className="team-grid">
        <div className="team-member">
          <img src="/path-to-photo.jpg" alt="John Doe" />
          <h3>John Doe</h3>
          <p>Lead Developer</p>
          <p>John specializes in AI and machine learning with over 10 years of experience.</p>
        </div>
        <div className="team-member">
          <img src="/path-to-photo.jpg" alt="Jane Smith" />
          <h3>Jane Smith</h3>
          <p>Project Manager</p>
          <p>Jane has managed numerous tech projects, ensuring timely delivery and client satisfaction.</p>
        </div>
        {/* Add more team members as needed */}
      </div>
    </section>
  );
}

export default TeamSection;
